"""
     dynamic_partition(data, partitions)

Partitions `data` into `num_partitions` tensors using indices from `partitions`.

For each index tuple `js` of size `partitions.ndim`, the slice `data[js, ...]`
becomes part of `outputs[partitions[js]]`.  The slices with `partitions[js] = i`
are placed in `outputs[i]` in lexicographic order of `js`, and the first
dimension of `outputs[i]` is the number of entries in `partitions` equal to `i`.
In detail,

```python
    outputs[i].shape = [sum(partitions == i)] + data.shape[partitions.ndim:]

    outputs[i] = pack([data[js, ...] for js if partitions[js] == i])
```

`data.shape` must start with `partitions.shape`.

For example:

```python
    # Scalar partitions.
    partitions = 1
    num_partitions = 2
    data = [10, 20]
    outputs[0] = []  # Empty with shape [0, 2]
    outputs[1] = [[10, 20]]

    # Vector partitions.
    partitions = [0, 0, 1, 1, 0]
    num_partitions = 2
    data = [10, 20, 30, 40, 50]
    outputs[0] = [10, 20, 50]
    outputs[1] = [30, 40]
```

<div style="width:70%; margin:auto; margin-bottom:10px; margin-top:20px;">
<img style="width:100%" src="../../images/DynamicPartition.png" alt>
</div>
"""
tf.@op function dynamic_partition(v992, v993; name=nothing, num_partitions=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("DynamicPartition") 
                    begin  
                        begin  
                            v992 = convert(TensorFlow.Tensor{Any}, v992) 
                            begin  
                            end
                        end
                        begin  
                            v993 = convert(TensorFlow.Tensor{Int32}, v993) 
                            begin  
                            end
                        end
                        begin  
                            (v992,) = tf.tf_promote(v992)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v992)
                        end
                        begin  
                            tf.add_input(desc, v993)
                        end
                    end 
                    begin  
                        begin  
                            if num_partitions !== nothing 
                                desc["num_partitions"] = Base.Int(num_partitions)
                            end
                        end
                    end
                end), name, "DynamicPartition") 
        begin  
            out = tf.Tensor[] 
            op = tf.Operation(desc) 
            for out_idx = 1:num_partitions 
                push!(out, tf.Tensor(op, out_idx))
            end 
            out
        end
    end

