                        end
                    end 
                    begin  
                        begin  
                            if num_true !== nothing 
                                desc["num_true"] = Base.Int(num_true)
                            end
                        end
                        begin  
                            if seed !== nothing 
                                desc["seed"] = Base.Int(seed)
                            end
                        end
                        begin  
