                        begin  
                            v1221 = convert(TensorFlow.Tensor{Bool}, v1221) 
                            begin  
                            end
                        end
                        begin  
                            (v1220,) = tf.tf_promote(v1220)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1220)
                        end
                        begin  
                            tf.add_input(desc, v1221)
                        end
                    end 
                    begin  
                    end
                end), name, "Reverse") 
