"""
     all_candidate_sampler(true_classes; seed=0, seed2=0)

Generates labels for candidate sampling with a learned unigram distribution.

See explanations of candidate sampling and the data formats at
go/candidate-sampling.

For each batch, this op picks a single set of sampled candidate labels.

The advantages of sampling candidates per-batch are simplicity and the
possibility of efficient dense matrix multiplication. The disadvantage is that
the sampled candidates must be chosen independently of the context and of the
true labels.
"""
tf.@op function all_candidate_sampler(v1490; name=nothing, num_true=nothing, num_sampled=nothing, unique=nothing, seed=nothing, seed2=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("AllCandidateSampler") 
                    begin  
                        begin  
                            v1490 = convert(TensorFlow.Tensor{Int64}, v1490) 
                            begin  
                            end
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1490)
                        end
                    end 
                    begin  
                        begin  
                            if num_true !== nothing 
                                desc["num_true"] = Base.Int(num_true)
                            end
                        end
                        begin  
                            if num_sampled !== nothing 
                                desc["num_sampled"] = Base.Int(num_sampled)
                            end
                        end
                        begin  
                            if unique !== nothing 
                                desc["unique"] = Base.Bool(unique)
                            end
                        end
                        begin  
                            if seed !== nothing 
                                desc["seed"] = Base.Int(seed)
                            end
                        end
                        begin  
                            if seed2 !== nothing 
                                desc["seed2"] = Base.Int(seed2)
                            end
                        end
                    end
                end), name, "AllCandidateSampler") 
        begin  
            out = tf.Tensor[] 
            op = tf.Operation(desc) 
            for out_idx = 1:3 
                push!(out, tf.Tensor(op, out_idx))
            end 
            out
        end
    end

