"""
     resource_apply_proximal_adagrad(var, accum, lr, l1, l2, grad; use_locking=false)

Update '*var' and '*accum' according to FOBOS with Adagrad learning rate.

accum += grad * grad
prox_v = var - lr * grad * (1 / sqrt(accum))
var = sign(prox_v)/(1+lr*l2) * max{|prox_v|-lr*l1,0}
"""
tf.@op function resource_apply_proximal_adagrad(v1498, v1499, v1500, v1501, v1502, v1503; name=nothing, use_locking=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("ResourceApplyProximalAdagrad") 
                    begin  
                        begin  
                            v1498 = convert(TensorFlow.Tensor{Any}, v1498) 
                            begin  
                            end
                        end
                        begin  
                            v1499 = convert(TensorFlow.Tensor{Any}, v1499) 
                            begin  
                            end
                        end
                        begin  
                            v1500 = convert(TensorFlow.Tensor{Any}, v1500) 
                            begin  
                            end
                        end
                        begin  
                            v1501 = convert(TensorFlow.Tensor{Any}, v1501) 
                            begin  
                            end
                        end
                        begin  
                            v1502 = convert(TensorFlow.Tensor{Any}, v1502) 
                            begin  
                            end
                        end
                        begin  
                            v1503 = convert(TensorFlow.Tensor{Any}, v1503) 
                            begin  
                            end
                        end
                        begin  
