                        end
                        begin  
                            tf.add_input(desc, v1502)
                        end
                        begin  
                            tf.add_input(desc, v1503)
                        end
                    end 
                    begin  
                        begin  
                            if use_locking !== nothing 
                                desc["use_locking"] = Base.Bool(use_locking)
                            end
                        end
                    end
                end), name, "ResourceApplyProximalAdagrad") 
        tf.Tensor(tf.Operation(desc))
    end

