        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("Prod") 
                    begin  
                        begin  
                            v1510 = convert(TensorFlow.Tensor{Any}, v1510) 
                            begin  
                            end
                        end
                        begin  
                            v1511 = convert(TensorFlow.Tensor{Int32}, v1511) 
                            begin  
                                v1511 = v1511 - convert(tf.Tensor{eltype(v1511)}, 1)
                            end
                        end
                        begin  
                            (v1510,) = tf.tf_promote(v1510)
                        end
                        begin  
                            (v1511,) = tf.tf_promote(v1511)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1510)
                        end
                        begin  
                            tf.add_input(desc, v1511)
                        end
                    end 
                    begin  
                        begin  
                            if keep_dims !== nothing 
                                desc["keep_dims"] = Base.Bool(keep_dims)
                            end
                        end
                    end
                end), name, "Prod") 
        tf.Tensor(tf.Operation(desc))
    end

