                            begin  
                            end
                        end
                        begin  
                            v1650 = convert(TensorFlow.Tensor{Int64}, v1650) 
                            begin  
                            end
                        end
                        begin  
                            (v1648,) = tf.tf_promote(v1648)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1648)
                        end
                        begin  
                            tf.add_input(desc, v1649)
                        end
                        begin  
                            tf.add_input(desc, v1650)
                        end
