        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("QuantizeAndDequantizeV2") 
                    begin  
                        begin  
                            v1894 = convert(TensorFlow.Tensor{Any}, v1894) 
                            begin  
                            end
                        end
                        begin  
                            v1895 = convert(TensorFlow.Tensor{Any}, v1895) 
                            begin  
                            end
                        end
                        begin  
                            v1896 = convert(TensorFlow.Tensor{Any}, v1896) 
                            begin  
                            end
                        end
                        begin  
                            (v1894, v1895, v1896) = tf.tf_promote(v1894, v1895, v1896)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1894)
