        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("ListDiff") 
                    begin  
                        begin  
                            v1982 = convert(TensorFlow.Tensor{Any}, v1982) 
                            begin  
                            end
                        end
                        begin  
                            v1983 = convert(TensorFlow.Tensor{Any}, v1983) 
                            begin  
                            end
                        end
                        begin  
                            (v1982, v1983) = tf.tf_promote(v1982, v1983)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v1982)
                        end
                        begin  
                            tf.add_input(desc, v1983)
                        end
                    end 
                    begin  
                        begin  
                            if out_idx !== nothing 
                                desc["out_idx"] = Base.identity(out_idx)
                            end
                        end
                    end
                end), name, "ListDiff") 
        begin  
            out = tf.Tensor[] 
