                    desc = tf.NodeDescription("StringToHashBucketStrong") 
                    begin  
                        begin  
                            v2013 = convert(TensorFlow.Tensor{String}, v2013) 
                            begin  
                            end
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v2013)
                        end
                    end 
                    begin  
                        begin  
                            if num_buckets !== nothing 
                                desc["num_buckets"] = Base.Int(num_buckets)
