                            v2129 = convert(TensorFlow.Tensor{Int64}, v2129) 
                            begin  
                            end
                        end
                        begin  
                            v2130 = convert(TensorFlow.Tensor{Any}, v2130) 
                            begin  
                            end
                        end
                        begin  
                            v2131 = convert(TensorFlow.Tensor{Int64}, v2131) 
                            begin  
                            end
                        end
                        begin  
                            (v2130,) = tf.tf_promote(v2130)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v2129)
                        end
                        begin  
                            tf.add_input(desc, v2130)
                        end
                        begin  
                            tf.add_input(desc, v2131)
                        end
                    end 
                    begin  
                    end
                end), name, "SparseSoftmax") 
        tf.Tensor(tf.Operation(desc))
    end

