                            begin  
                            end
                        end
                        begin  
                            v2139 = convert(TensorFlow.Tensor{Any}, v2139) 
                            begin  
                            end
                        end
                        begin  
                            v2140 = convert(TensorFlow.Tensor{Any}, v2140) 
                            begin  
                            end
                        end
                        begin  
                            (v2139, v2140) = tf.tf_promote(v2139, v2140)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v2138)
                        end
                        begin  
                            tf.add_input(desc, v2139)
                        end
                        begin  
                            tf.add_input(desc, v2140)
                        end
                    end 
                    begin  
                    end
                end), name, "Select") 
        tf.Tensor(tf.Operation(desc))
    end

