"""
     scatter_nd_update(ref, indices, updates; use_locking=true)

Applies sparse `updates` to individual values or slices within a given

variable according to `indices`.

`ref` is a `Tensor` with rank `P` and `indices` is a `Tensor` of rank `Q`.

`indices` must be integer tensor, containing indices into `ref`.
It must be shape `[d_0, ..., d_{Q-2}, K]` where `0 < K <= P`.

The innermost dimension of `indices` (with length `K`) corresponds to
indices into elements (if `K = P`) or slices (if `K < P`) along the `K`th
dimension of `ref`.

`updates` is `Tensor` of rank `Q-1+P-K` with shape:

```
[d_0, ..., d_{Q-2}, ref.shape[K], ..., ref.shape[P-1]].
```

For example, say we want to update 4 scattered elements to a rank-1 tensor to
8 elements. In Python, that update would look like this:

    ref = tf.Variable([1, 2, 3, 4, 5, 6, 7, 8])
    indices = tf.constant([[4], [3], [1] ,[7]])
    updates = tf.constant([9, 10, 11, 12])
    update = tf.scatter_nd_update(ref, indices, updates)
    with tf.Session() as sess:
      print sess.run(update)

The resulting update to ref would look like this:

    [1, 11, 3, 10, 9, 6, 7, 12]

See [tf.scatter_nd](#scatter_nd) for more details about how to make updates to
slices.
"""
tf.@op function scatter_nd_update(v2238, v2239, v2240; name=nothing, use_locking=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("ScatterNdUpdate") 
                    begin  
                        begin  
                            v2238 = convert(TensorFlow.Tensor{Any}, v2238) 
                            begin  
                            end
                        end
                        begin  
                            v2239 = convert(TensorFlow.Tensor{Any}, v2239) 
                            begin  
                                v2239 = v2239 - convert(tf.Tensor{eltype(v2239)}, 1)
                            end
                        end
                        begin  
                            v2240 = convert(TensorFlow.Tensor{Any}, v2240) 
                            begin  
                            end
                        end
                        begin  
                            (v2238, v2240) = tf.tf_promote(v2238, v2240)
                        end
                        begin  
                            (v2239,) = tf.tf_promote(v2239)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v2238)
                        end
                        begin  
                            tf.add_input(desc, v2239)
                        end
                        begin  
                            tf.add_input(desc, v2240)
                        end
                    end 
                    begin  
                        begin  
                            if use_locking !== nothing 
                                desc["use_locking"] = Base.Bool(use_locking)
                            end
                        end
                    end
                end), name, "ScatterNdUpdate") 
        tf.Tensor(tf.Operation(desc))
    end

"""
     dynamic_stitch(indices, data)

Interleave the values from the `data` tensors into a single tensor.

Builds a merged tensor such that

```python
    merged[indices[m][i, ..., j], ...] = data[m][i, ..., j, ...]
```

For example, if each `indices[m]` is scalar or vector, we have

```python
    # Scalar indices:
    merged[indices[m], ...] = data[m][...]

    # Vector indices:
    merged[indices[m][i], ...] = data[m][i, ...]
```

Each `data[i].shape` must start with the corresponding `indices[i].shape`,
and the rest of `data[i].shape` must be constant w.r.t. `i`.  That is, we
must have `data[i].shape = indices[i].shape + constant`.  In terms of this
`constant`, the output shape is

    merged.shape = [max(indices)] + constant

Values are merged in order, so if an index appears in both `indices[m][i]` and
`indices[n][j]` for `(m,i) < (n,j)` the slice `data[n][j]` will appear in the
merged result.

For example:

```python
    indices[0] = 6
    indices[1] = [4, 1]
    indices[2] = [[5, 2], [0, 3]]
    data[0] = [61, 62]
    data[1] = [[41, 42], [11, 12]]
    data[2] = [[[51, 52], [21, 22]], [[1, 2], [31, 32]]]
    merged = [[1, 2], [11, 12], [21, 22], [31, 32], [41, 42],
              [51, 52], [61, 62]]
```

<div style="width:70%; margin:auto; margin-bottom:10px; margin-top:20px;">
<img style="width:100%" src="../../images/DynamicStitch.png" alt>
</div>
"""
tf.@op function dynamic_stitch(v2241, v2242; name=nothing, N=nothing) 
        local desc 
        tf.with_op_name((()->begin  
                    desc = tf.NodeDescription("DynamicStitch") 
                    begin  
                        begin  
                            v2241 = [convert(TensorFlow.Tensor{Int32}, x) for x = v2241] 
                            begin  
                            end
                        end
                        begin  
                            v2242 = [convert(TensorFlow.Tensor{Any}, x) for x = v2242] 
                            begin  
                            end
                        end
                        begin  
                            (v2242,) = tf.tf_promote(v2242)
                        end
                    end 
                    begin  
                        begin  
                            tf.add_input(desc, v2241)
                        end
                        begin  
                            tf.add_input(desc, v2242)
                        end
                    end 
                    begin  
                        begin  
                            if N !== nothing 
                                desc["N"] = Base.Int(N)
                            end
                        end
                    end
                end), name, "DynamicStitch") 
        tf.Tensor(tf.Operation(desc))
    end

